import React, { Component } from 'react';
import ReactGA from 'react-ga';
import $ from 'jquery';
import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';
import About from './Components/About';
import Resume from './Components/Resume';
import Contact from './Components/Contact';
import Testimonials from './Components/Testimonials';
import Portfolio from './Components/Portfolio';
import ca2 from './img/ca2.gif';
import reunion from './img/reunion.gif';
import heicoders from './img/heicoders.png';
import scis from './img/scis.gif';
import dm from './img/dm.png';
import test from './img/test.png';
import {Helmet} from "react-helmet";

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
    };
  }

  componentDidMount () {
    const script = document.createElement("script");

    script.src = "./main.js";
    script.async = true;

    document.body.appendChild(script);
}

  render() {
    return (
      <div>
      <meta charSet="utf-8" />
      <title>Felice Png</title>
      <link rel="stylesheet" type="text/css" href="style.css" />
      <link rel="stylesheet" type="text/css" href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css" />
      <link href="https://fonts.googleapis.com/css?family=Montserrat|Baloo+Chettan+2|Tangerine&display=swap" rel="stylesheet" />
      <Helmet>
                <script src="main.js"></script>
                <script>try{Typekit.load({ async: true })}catch(e){}</script>
            </Helmet>
      <header>
        <nav>
          <ul>
            <li><a className="active" href="index.html">Home</a></li>
            <li><a href="">Portfolio</a></li>
            <li><a href="">Resume</a></li>
          </ul>
        </nav>
      </header>
      <div className="top-container">
        <div className="intro">
          <h1>Hi, I'm Felice</h1>
          <p id="p1">an aspiring software developer.</p> 
          <img id="test" className="img" src={test} alt="test" />
        </div>
        <div className="bubbles">
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
        </div>
      </div>   
      <div className="middle-container">
        <div className="profile">
          <p id="p1"><br></br><br></br>... also, i design things.</p> 
          <img className="midlogo" src={ca2} alt="ca2" />
          <img className="midlogo" src={heicoders} alt="heicoders" />
          <img className="midlogo" src={reunion} alt="reunion" />
          <img className="midlogoend" src={scis} alt="scis" />
        </div>
      </div>
    </div>
    );
  }
}

export default App;
